            <Span> <FontAwesomeIcon icon={faCompass} size="2x" /> </Span>
            <Span> <FontAwesomeIcon icon={faHeart} size="2x" /> </Span>
            <Span> <Img src={avatarIcon} alt="profile_image"/> </Span>
          </Icon>
        </Header>

